s.x:
var $bm_rt;
var freq, decay, n, n, t, amp, w;
freq = 3;
decay = 5;
$bm_rt = n = 0;
if (numKeys > 0) {
    $bm_rt = n = nearestKey(time).index;
    if (key(n).time > time)
        n--;
}
if (n > 0) {
    t = sub(time, key(n).time);
    amp = velocityAtTime(sub(key(n).time, 0.001));
    w = mul(mul(freq, Math.PI), 2);
    $bm_rt = sum(value, mul(amp, div(div(Math.sin(mul(t, w)), Math.exp(mul(decay, t))), w)));
} else
    $bm_rt = value;

